Dirty Wives Club - Chanel Preston
Added: October 13, 2014

Chanel and her husband have hit some hard times, her husband hasn't had any luck finding a job and the problems are becoming too much for her. Chanel decides to talk to her boss about getting a promotion. Mark invites her over to one of his houses after work and Chanel walks in somewhat nervous about the situation. Mark has her take seat on the couch to relax and decides she has too much on. Chanel gets up to go to the bathroom to give her husband a call letting him know that she will be staying late at &quot;work&quot;. She takes deep breath reassuring herself that she can do this before stepping out of the bathroom and onto Mark's bed then yelling out to him that she's ready to earn that promotion
